<script>

    function CheckedItem(Id, State) {
        var Data = new FormData();
        Data.append(""Id"", Id);
        Data.append(""State"", State);

        $.ajax({
            type: ""POST"",
            url: ""/PdfManagerArea/OtherContext/ChangeItemState/"",
            contentType: false,
            processData: false,
            data: Data,
            success: function (data) {
                if (data.success == true) {
                    location.reload();
                }
                else {

                    swal.fire(
                        'Warning',
                        data.message,
                        'warning'
                    );
                }

            },
            error: function (xhr, ajaxOptions, thrownError) {
                alert(xhr.status);
                alert(thrownError);
            }

        });
    }
    function ShowModal(Message) {
        document.getElementById(""areaContext"").value = Message;
        $(""#mdlContext"").modal('show');
    }

</");
